Verenigde Staten
Drama
90 minuten

geregisseerd door Lynn Shelton
met Ellen Page, Allison Janney en Rosemarie DeWitt

Een massage therapeut is niet in staat haar werk te doen als ze plots wordt bevangen door een afkeer van lichamelijk contact. Ondertussen ontvangt de tandheelkundige praktijk van haar bekrompen broer nieuwe klanten die op zoek gaan naar de helende werking van zijn aanraking.



